import React from "react";

import TaskList from "../components/TaskList";

const AllTasks = () => {
    const TASKS = [
        {
          taskId : 't1', 
          creator : 'Ananya Gupta', 
          taskDesc : 'Study JavaScript',
          creatorId: 'c1'                
       }
   ];
    return (
     <h2>Welcome to Personalize TO-DO List</h2>
    );

 return <TaskList items = {TASKS} />;
};

export default AllTasks;
